(2007,7,131,"fr","<div id=\"cke_pastebin\">\r\n	L&rsquo;Emetteur sera tenu de rembourser imm&eacute;diatement au Pr&ecirc;teur l&rsquo;ensemble des sommes dues au titre du Bon de caisse en cas de survenance de l&rsquo;un quelconque des &eacute;v&eacute;nements pr&eacute;vus ci-dessous.</div>\r\n<div id=\"cke_pastebin\">\r\n	&nbsp;</div>\r\n<div id=\"cke_pastebin\">\r\n	Constitue un Cas d&rsquo;Exigibilit&eacute; Anticip&eacute;e :</div>\r\n<div id=\"cke_pastebin\">\r\n	&nbsp;</div>\r\n<ol>\r\n	<li>\r\n		le non-paiement &agrave; leur &eacute;ch&eacute;ance par l&rsquo;Emetteur de trois remboursements mensuels dus au titre du Bon de caisse ;</li>\r\n	<li>\r\n		le non-respect par l&rsquo;Emetteur de l&rsquo;utilisation des fonds au projet de financement telle que pr&eacute;vue dans la pr&eacute;sentation du projet au pr&ecirc;teur ;</li>\r\n	<li>\r\n		l&rsquo;inexactitude de l&rsquo;une quelconque des informations et d&eacute;clarations relatives notamment &agrave; la situation financi&egrave;re de l&rsquo;Emetteur ;&nbsp;</li>\r\n	<li>\r\n		la non-certification des comptes de l&rsquo;Emetteur par le Commissaire aux Comptes.</li>\r\n</ol>\r\n<div id=\"cke_pastebin\">\r\n	&nbsp;</div>\r\n<div id=\"cke_pastebin\">\r\n	L&rsquo;Emetteur est tenu dans les 8 jours de la survenance d&rsquo;un Cas d&rsquo;Exigibilit&eacute; Anticip&eacute;e d&rsquo;en informer SFF PME, lequel a re&ccedil;u mandat du Pr&ecirc;teur en cas de d&eacute;faut de paiement comme en cas de survenance d&rsquo;un Cas d&rsquo;Exigibilit&eacute; Anticip&eacute;e de mandater une soci&eacute;t&eacute; de recouvrement.</div>\r\n<div id=\"cke_pastebin\">\r\n	&nbsp;</div>\r\n<div id=\"cke_pastebin\">\r\n	En cas de survenance d&rsquo;un Cas d&rsquo;Exigibilit&eacute; Anticip&eacute;, toutes les sommes dues par l&rsquo;Emetteur en ex&eacute;cution du Bon de caisse deviendront exigibles de plein droit sans qu&rsquo;il soit besoin de mise en demeure pr&eacute;alable de quelque nature que ce soit. L&rsquo;Emetteur devra alors payer imm&eacute;diatement tous montants dus (principal et int&eacute;r&ecirc;t courus) au titre du Bon de caisse sans pr&eacute;judice de tout autre dommage et int&eacute;r&ecirc;t qui pourrait &ecirc;tre d&ucirc; au Pr&ecirc;teur.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	<h3>\r\n		REMBOURSEMENT ANTICIPE</h3>\r\n</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	A chaque date d&#39;&eacute;ch&eacute;ance, l&#39;Emetteur pourra rembourser par anticipation, sans p&eacute;nalit&eacute;, l&#39;int&eacute;gralit&eacute; des sommes restant dues au titre du Bon de Caisse. En cas de remboursement anticip&eacute;, l&#39;Emetteur ne sera pas tenu au paiement des int&eacute;r&ecirc;ts non courus &agrave; la date de remboursement anticip&eacute;.&nbsp;</div>\r\n","",1,"2015-04-23 09:16:24","2015-04-23 09:16:24"),
